import React, {Component} from 'react';
//import { getMovies } from "../services/fakeMovieService";
import { Table, DataTable, TableHeader } from "react-mdl";


class Movies2 extends Component {
    render() {
        return (
            <React.Fragment>

                <p></p>

                <DataTable
                    shadow={0}
                    rows={[
                        {material: 'Acrylic (Transparent)', quantity: 25, price: 2.90},
                        {material: 'Plywood (Birch)', quantity: 50, price: 1.25},
                        {material: 'Laminate (Gold on Blue)', quantity: 10, price: 2.35}
                    ]}
                >
                    <TableHeader name="material" tooltip="title">Title</TableHeader>
                    <TableHeader name="quantity" tooltip="genre.name">Genre</TableHeader>
                    <TableHeader numeric name="quantity" tooltip="NumberInStock">Stock</TableHeader>
                    <TableHeader numeric name="price" cellFormatter={(price) => `\$${price.toFixed(2)}`} tooltip="dailyRentRate">Rate</TableHeader>
                </DataTable>

            </React.Fragment>
        );
    }
}

export default Movies2;
